import React from 'react';
import { Box, Container, Typography, AppBar, Toolbar } from '@mui/material';

const Navbar = () => (
  <AppBar
    position="fixed"
    sx={{
      background: 'rgba(0, 0, 0, 0.8)',
      backdropFilter: 'blur(8px)',
      borderBottom: '1px solid rgba(122, 86, 214, 0.2)',
      boxShadow: '0 4px 30px rgba(122, 86, 214, 0.1)',
    }}
  >
    <Container maxWidth="lg">
      <Toolbar sx={{ height: '70px', position: 'relative' }}>
        <img 
          src="/logo.png"
          alt="Roxiler Logo"
          style={{
            width: '140px',
            height: '120px',
            objectFit: 'contain',
            filter: 'drop-shadow(0 0 8px rgba(122, 86, 214, 0.5))',
            position: 'absolute',
            left: 0
          }}
        />
        <Box sx={{ 
          width: '100%',
          display: 'flex',
          justifyContent: 'center',
          position: 'relative',
          '&::before': {
            content: '""',
            position: 'absolute',
            left: -20,
            right: -20,
            height: '2px',
            bottom: -10,
            background: 'linear-gradient(90deg, transparent, #7a56d6, transparent)',
          }
        }}>
          <Typography 
            variant="h4" 
            component="h1"
            sx={{
              fontSize: { xs: '1.8rem', md: '2.5rem' },
              fontWeight: 'bold',
              fontFamily: 'Montserrat, sans-serif',
              background: 'linear-gradient(90deg, #7a56d6, #ffffff)',
              backgroundSize: '200% auto',
              WebkitBackgroundClip: 'text',
              WebkitTextFillColor: 'transparent',
              animation: 'gradient 8s ease infinite',
              '@keyframes gradient': {
                '0%': { backgroundPosition: '0% center' },
                '50%': { backgroundPosition: '100% center' },
                '100%': { backgroundPosition: '0% center' }
              }
            }}
          >
            Roxiler Product Management
          </Typography>
        </Box>
      </Toolbar>
    </Container>
  </AppBar>
);

export default Navbar;
